import React, { Component } from 'react';
import './App.css';

class App extends Component {
  foo = () => 'Bats';

  render() {
    const name = 'Alex Bogdanov';

    return (
      <div className='App'>
        <h1>Hello {this.foo()}</h1>
        <label htmlFor='Name'>Name</label>
      </div>
    );
  }
}

export default App;
